@Beauty As Being One might say the modern Maleficent represents aspects of mother nature, but the original Maleficent in Sleeping Beauty did not especially since Maleficent specifically states how she will unnaturally use "all the powers of Hell" and became an unnatural monstrous fire-breathing dragon.  The original character was more a satanical/monstrous villain representation sadistically attacking a defenseless child at a religious christening to give viewers and children at that time an easy identified villain to recognize as a stark contrast to the loving family and innocent Aurora.

The modern Maleficent movie, besides having serious plot holes (that's another story), has Maleficent do nothing maternal or nurturing. She never fed Aurora or help provide her shelter or changed her diapers or taught her anything (how to walk, how to talk, hygiene, manners, social skills, etc). Secretly spying and child stalking someone else's child behind everyone's backs is not maternal or supportive. Most civilized societies find child stalkers creepy. At best, Maleficent became teen Aurora's edgy girlfriend after she hung out with teen Aurora, like friends do. Before that her hissing at baby Aurora, telling baby Aurora she hates her, putting a thunderstorm in the house the baby was in are far from being maternal or supportive. If Maleficent truly cared about Aurora she wouldn't have waited 15days, much less ~15years, to try to remove the curse she put on her. That aside, mother nature proves all the time it is powerful, without mercy and unforgiving... so in that sense Maleficent in that movie did portray that.

That aside, the Maleficent trailers for both Maleficent movies also made it seem like Maleficent was going to be evil... then put the "she's just misunderstood and a victim to pity" spin on it in the actual movie, so I wouldn't be surprised to see the same thing with the Cruella movie.

@VJ4rawr2 lmao you know that Disney lied to cinemas for a year and said it'd show this movie in them exclusively for a period (like what's usually done with movies) to help them get back on their feet, but now last week they said "nah actually you know what? We're going to release it on streaming day-of."

Disney is trying to kill cinema so that they can get all your money directly and not have to pay for a theater over your head.

